navigation.editor_street:
Vlastnosti ulice jsou jiné než pro radnici.{br}
Zde například '{field1}' a '{field2}'. 
**Nyní zavřete editor vlastností (Esc či {button})**

points.add_name:
Nenechte se zaskočit množstvím polí - stačí zadat ty vlastnosti, které znáte :-){br}
Řekněme, že víte název kavárny. 
**Zadejte název**

areas.continue_playground:
Pokračujte přidáváním bodů do rohů hřiště. {br}
Plochu můžete spojit s existující pěšinou. (Pokud tomu naopak chcete zabránit držte klávesu Alt)
**Přidejte další body do hřiště**

lines.intersect:
Přidejte další body kliknutím nebo mezerníkem.{br}
Většina linií jsou vždy součástí větší sítě - je důležité napojit linie na sebe, aby fungovalo třeba hledání trasy.
**Vytvořte křižovatku kliknutím na ulici {name}.**

buildings.add_building:
OSM je mimojiné také největší databází budov.{br}
Pokud někde budova chybí, můžete přidat její obrys.{br}
Pozor: letecké snímky v ČR často nesedí - neopravujte, prosím, existující budovy, pokud si nejste jisti.
**Přidejte novou plochu tlačítkem {button} Plocha**

buildings.start_building:
Pojďme přidat třeba tenhle barák.{br}
Zkuste budovu oklikat co nejpřesněji.
**Začněte kreslit kliknutím do rohu**

buildings.continue_building:
Přidejte postupně další body do rohů, můžete i přizoomovat.{br}
Zadávání ukončíte kliknutím na první či poslední bod.
**Dokončete obrys budovy**
